      <div className="app-content">{props.children}</div>

      {/* {props.children} */}

      {/*STYLING with styled-jsx*/}
      
      <style jsx>{`
        .layout {
          width: 100%;
          height: 100vh;
          background-color: var(--color-dim-white);

          display: flex;
          
        }
      `}</style>
    
    </div>
  );
}

export default Layout;
